import React from "react";
import { Switch, BrowserRouter, Route } from "react-router-dom";
import App from "./App";
const Success   = lazy(() => import('./sucess'));
const UrlRouter: React.FC = () => (
  <BrowserRouter>
    <Switch>
      <Route path="/:username">
        <App/>
      </Route>
      <Route>
        <Success/>
      </Route>
    </Switch>
  </BrowserRouter>
);

export default UrlRouter;
